import React, { useState } from 'react';
import styled from 'styled-components';
import UserItem from './UserItem';

const UserList = () => {
  const [dummy, setDummy] = useState([
    {
      id: 0,
      name: 'Kim',
      username: 'narciss',
      email: 'private.narc2ss@gmail.com',
    },
    {
      id: 1,
      name: 'Jang',
      username: 'narciss',
      email: 'private.narc2ss@gmail.com',
    },
    {
      id: 2,
      name: 'Soo',
      username: 'narciss',
      email: 'private.narc2ss@gmail.com',
    },
  ]);
  return (
    <UserListBlock>
      {dummy.map((person) => (
        <UserItem key={person.id} person={person} />
      ))}
    </UserListBlock>
  );
};

export default UserList;

const UserListBlock = styled.div``;
